import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { SharedModule } from './shared/shared.module';
import { BrowserAnimationsModule } from '@angular/platform-browser/animations';
import { FlexLayoutModule } from '@angular/flex-layout';

@NgModule({
  declarations: [AppComponent],
  imports: [
    BrowserModule,
    AppRoutingModule,
    SharedModule,
    BrowserAnimationsModule,
    FlexLayoutModule,
  ],
  providers: [],
  bootstrap: [AppComponent],
})
export class AppModule {}

import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';

const routes: Routes = [
  {
    path: 'medical-staff',
    loadChildren: () =>
      "import('./modules/medical-staff/medical-staff.module').then(\
        (m) => m.MedicalStaffModule\
      )",
  },
  {
    path: 'patient',
    loadChildren: () =>
      "import('./modules/patient/patient.module').then((m) => m.PatientModule)",
  },
  {
    path: 'profile',
    loadChildren: () =>
      "import('./modules/profile/profile.module').then((m) => m.ProfileModule)",
  },
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule],
})
export class AppRoutingModule {}

import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { LayoutPageComponent } from './pages/layout-page/layout-page.component';
import { HeaderComponent } from './components/header/header.component';
import { FooterComponent } from './components/footer/footer.component';
import { MatToolbarModule } from '@angular/material/toolbar';
import { MatButtonModule } from '@angular/material/button';
import { FlexLayoutModule } from '@angular/flex-layout';
import { MatSidenavModule } from '@angular/material/sidenav';
import { MatListModule } from '@angular/material/list';
import { MatIconModule } from '@angular/material/icon';
import { NavListComponent } from './components/nav-list/nav-list.component';
import { LogoComponent } from './components/logo/logo.component';
import { VisitDetailsComponent } from './components/visit-details/visit-details.component';

@NgModule({
  declarations: [
    LayoutPageComponent,
    HeaderComponent,
    FooterComponent,
    NavListComponent,
    LogoComponent,
    VisitDetailsComponent,
  ],
  imports: [
    CommonModule,
    MatToolbarModule,
    MatButtonModule,
    FlexLayoutModule,
    MatSidenavModule,
    MatListModule,
    MatIconModule,
  ],
  exports: [LayoutPageComponent, VisitDetailsComponent],
})
export class LayoutModule {}

